{"operationName":"TrelloNotificationsGetUnreadQuickCapture","variables":{"offset":11},"query":"query TrelloNotificationsGetUnreadQuickCapture($offset: Int = 10) {
  trello {
    me @optIn(to: "TrelloMe") {
      id
      notifications(
        filter: {status: "UNREAD", types: ["QUICK_CAPTURE"]}
        first: $offset
      ) @optIn(to: "TrelloMemberNotifications") {
        edges {
          node {
            ... on TrelloQuickCaptureNotification {
              ...TrelloQuickCaptureNotificationFields
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment TrelloQuickCaptureNotificationFields on TrelloQuickCaptureNotification {
  id
  card {
    id
    __typename
  }
  __typename
}"}
